import {gwRequest, request} from '~/utils/fetch'
export default {
  downloadSignAgreement: (ids) => {
    return gwRequest(
      'bank.api.agreementsignatureservice.recordbranchdownload',
      [{ids}],
    )
  },
  getCategory: (type) => {
    return gwRequest(
      'report.api.read.reporteventreadservice.queryreporteventservice',
      [
        {
          category: 0,
          type,
        },
      ],
    )
  },
  getAllProducts: () => {
    return gwRequest('report.api.read.creditreportreadservice.allproducts', [
      {},
    ])
  },
  getCreditReportList: (params) => {
    return gwRequest(
      'report.api.read.creditreportreadservice.selectcreditreportpageservice',
      [params],
    )
  },
  getSecondReportList: (params) => {
    return gwRequest(
      'report.api.read.virtualbankaccountreportreadservice.selectvirtualbankaccountreportpageservice',
      [params],
    )
  },
  exportSecondReportList: (params) => {
    return gwRequest(
      'report.api.read.virtualbankaccountreportreadservice.exportdata',
      [params],
    )
  },
  exportCreditReportList: (params) => {
    return gwRequest('report.api.read.creditreportreadservice.exportdata', [
      params,
    ])
  },
  uploadCreditReportList: (params) => {
    return gwRequest(
      'report.api.write.creditreportwriteservice.importfeedbackfile',
      [params],
    )
  },

  // 个人贷款发生额信息查询
  getLoanGrantQuery: (params) => {
    return request('financial/basic/loan/grant/query', 'post', params)
  },

  // 个人客户基础信息
  getUserInfoQuery: (params) => {
    return request('financial/basic/user/info/query', 'post', params)
  },

  // 存量个人贷款信息
  getExistGrantQuery: (params) => {
    return request('financial/basic/exist/grant/query', 'post', params)
  },

  // 下载个人贷款发生额
  downLoanGrantQuery: (params) => {
    return request('financial/basic/loan/grant/download', 'post', params)
  },

  // 下载个人客户基础信息
  downUserInfoQuery: (params) => {
    return request('financial/basic/user/info/download', 'post', params)
  },

  // 下载存量个人贷款信息
  downExistGrantQuery: (params) => {
    return request('financial/basic/exist/grant/download', 'post', params)
  },
  // 导出存量个人贷款信息
  downGeneration: (params) => {
    return request('/financial/generation/data/download', 'post', params)
  },

  // 一代征信报送导出
  generationExportdata: (params) => {
    return gwRequest(
      'report.api.read.generationcreditreportreadservice.exportdata',
      [params],
    )
  },
  // 一代征信报送导出
  exportpersonal: (params) => {
    return gwRequest(
      'report.api.read.generationcreditreportreadservice.exportpersonal',
      [params],
    )
  },
}
